import React from "react";
import { NavLink, useNavigate } from "react-router-dom";

function Navbar() {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Placeholder for logout logic (e.g., clear token, session)
    console.log("User logged out");
    // Redirect to Home page
    navigate("/");
  };

  return (
    <nav className="bg-blue-600 p-4 shadow-md">
      <div className="container mx-auto flex justify-between items-center">
        <h1 className="text-white text-2xl font-bold">NexusEd</h1>
        <div className="space-x-4">
          <NavLink
            to="/"
            className={({ isActive }) =>
              isActive
                ? "text-blue-200 underline"
                : "text-white hover:text-blue-200"
            }
          >
            Home
          </NavLink>
          <NavLink
            to="/profile"
            className={({ isActive }) =>
              isActive
                ? "text-blue-200 underline"
                : "text-white hover:text-blue-200"
            }
          >
            Profile
          </NavLink>
          <button
            onClick={handleLogout}
            className="text-white hover:text-blue-200 bg-transparent border-none cursor-pointer"
          >
            Logout
          </button>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
